import React from 'react';

const AboutUs = ()=> {
  return (
    <div className="about-us bg-gray-100 py-12">
      <div className="container mx-auto text-center">
        <h2 className="text-4xl font-bold mb-6">Giới thiệu về cửa hàng</h2>
        <p className="text-lg">
          Cửa hàng chúng tôi cam kết cung cấp các loại trái cây tươi ngon, hợp tác với các nông trại uy tín
          nhằm mang đến cho khách hàng sản phẩm tốt nhất.
        </p>
      </div>
    </div>
  );
}

export default AboutUs;
